import { Card, Form } from "antd";
import React, {useEffect, } from "react";
import {getUser} from "../services";

export const Home = () => {
    useEffect(() => {
        getUser();
    })

    return (
        <div>
            <Card>
                <Form>
                    <table>
                        <tr>
                            <th>No</th>
                            <th>Nama Perusahaan</th>
                            <th>Email</th>
                            <th>Password</th>
                            <th>Negara</th>
                            <th>Alamat</th>
                            <th>Mata Uang</th>
                            <th>Bahasa</th>
                            <th>Zona Waktu</th>
                        </tr>
                    </table>
                </Form>
            </Card>
        </div>
    );
};
